import React from "react";
import Container from "./container";
import pic1 from "../images/icon-sedans.svg";
import pic2 from "../images/icon-suvs.svg";
import pic3 from "../images/icon-luxury.svg";
function Main(){
    return(
        <div className="main">
            <Container
                img={pic1}
                name="SEDANS"
            />
            <Container
                img={pic2}
                name="SUVS"
            />
            <Container
                img={pic3}
                name="LUXURY"
            />
        </div>
    )
}

export default Main;
